import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { Button } from '@material-ui/core';


class Login extends Component {
    constructor(props) {
        super(props)
        this.state = {
            userId: '',
            pass: '',
        }
    }


    FuncLogin = () => {
        const { userId, pass } = this.state
        var userData = {
            userId,
            pass
        }
        this.props.continueLogin(userData)
    }

    render() {
        return (
            <div >
                <h1>Login1</h1>
                <div id="Login">
                <p>UserId:</p>
                <input type="text" onChange={(e) => this.setState({ userId: e.target.value })} value={this.state.userId} ></input>
                <p>Pass:</p>
                <input type="text" onChange={(e) => this.setState({ pass: e.target.value })} value={this.state.pass}></input>
                </div>
                <br /><br></br>
                <Button variant="contained" color="secondary" onClick={this.FuncLogin} >
                    Login
                </Button>

            </div>
        )
    }
}
export default withRouter(Login);
